// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import your components from the new paths
import Header from './components/Header'; // Assuming Header is in src/components/Header/index.js
import About from './components/About'; // Assuming About is in src/components/About/index.js
import Register from './components/Register'; // New import
import ContactUs from './components/ContactUs'; // New import
import ProtectedRoute from './components/ProtectedRoute'; // Your ProtectedRoute component
// Assuming you also have Login, Dashboard, Profile components
import Login from './components/Login'; // Example
import Dashboard from './components/Dashboard'; // Example
import Profile from './components/Profile'; // Example


import './App.css'; // Make sure this path is correct for your main App.css

const App = () => {
  // You might have state for authentication here
  const isAuthenticated = true; // Replace with actual auth logic

  return (
    <Router>
      {/* If Header is part of the global layout, render it outside <Routes> */}
      {/* <Header /> */}

      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Home />} /> {/* Assuming you have a Home component */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/contact" element={<ContactUs />} />
        <Route path="/about" element={<About />} />

        {/* Protected routes */}
        <Route
          path="/dashboard"
          element={isAuthenticated ? <Dashboard /> : <Navigate to="/login" />}
        />
        <Route
          path="/profile"
          element={isAuthenticated ? <Profile /> : <Navigate to="/login" />}
        />
        {/* You can still use ProtectedRoute if you prefer that pattern */}
        {/* <Route path="/dashboard" element={<ProtectedRoute component={Dashboard} />} /> */}
        {/* <Route path="/profile" element={<ProtectedRoute component={Profile} />} /> */}


        {/* Catch-all route for 404 or redirect to home */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
};

const Home = () => <div><Header /><h1>Welcome to Garuda AI Tax Assistant!</h1></div>; // Simple placeholder Home

export default App;
